import React, { Component } from 'react';

import { Link } from 'react-router-dom';
import axios from 'axios';

const Message = props => (
    <tr>
      <td>{props.message.msg}</td>
      <td>{props.message.by}</td>
      <td>{props.message.timestamp.substring(0,10)}</td>
      <td>{props.message.room}</td>
      <td>
        <Link to={"/editMessage/"+props.message._id}>edit</Link> | <a href="#" onClick={() => { props.deleteEvent(props.message._id) }}>delete</a>
      </td>
    </tr>
  )

export default class MessagelogList extends Component {
    render() {
        return (
            <div>
                <p>You are on message list</p>
            </div>
        )
    }

}
